INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAP', 'STOCK', 'Advance Auto Parts, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto Parts', 'A ADVANCE Auto Parts, Inc. É uma fornecedora de peças de reposição automotiva na América do Norte, servindo clientes profissionais de instaladores (profissionais) e faça você mesmo (DIY), bem como operadores de propriedade independente. As lojas e filiais da empresa oferecem uma gama de marcas, fabricante de equipamentos originais (OEM) e peças de reposição automotivas de marca própria, acessórios, baterias e itens de manutenção para carros domésticos e importados, vans, veículos utilitários esportivos e caminhões leves e pesados. A empresa opera aproximadamente 4 788 lojas principalmente nos Estados Unidos (EUA), com locais adicionais no Canadá, Porto Rico e Ilhas Virgens dos EUA. A empresa também atende aproximadamente 934 lojas de marca Carquest de propriedade independente nesses locais, além do México e de várias ilhas do Caribe. Suas lojas operam principalmente sob as marcas Advance Auto Parts e Carquest.', 'Raleigh, NC, United States', 33200);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VLTO', 'STOCK', 'Veralto Corporation', 'NYQ', 'Industrials', 'Pollution & Treatment Controls', 'Veralto Corporation provides essential technology solutions that monitor, enhance and protect key resources around the globe. Its segments include Water Quality (WQ) and Product Quality & Innovation (PQI). WQ segment provides portfolios of water analytics and differentiated water treatment solutions that enable the delivery of safe drinking water by public and private utilities. Under its Hach, Trojan Technologies, ChemTreat and other globally recognized WQ brands, it provides precision instrumentation and advanced water treatment technologies that its customers rely on to measure, analyze and treat water in residential, commercial, municipal, industrial, research and natural resource applications. PQI segment provides a set of essential solutions for brand owners and consumer packaged goods companies. Under its Videojet, Linx, Esko, X-Rite, Pantone and other globally recognized PQI brands, it provides marking and coding, and packaging and color instrumentation and related consumables.', 'Waltham, MA, United States', 17000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNX', 'STOCK', 'CNX Resources Corporation', 'NYQ', 'Energy', 'Oil & Gas E&P', 'CNX Resources Corporation is an ultra-low carbon intensive natural gas development, production, midstream, and technology company centered in Appalachia, United States. The Company''s operations are primarily centered on unconventional shale formations, primarily the Marcellus Shale and Utica Shale, in Pennsylvania, Ohio and West Virginia. Additionally, it operates and develops Coalbed Methane (CBM) properties in Virginia. It has rights to extract natural gas from Shale formations in Pennsylvania, West Virginia, and Ohio from approximately 528,000 net Marcellus Shale acres and 606,000 net Utica Shale acres. It has rights to extract CBM in Virginia from approximately 283,000 net CBM acres. It extracts CBM natural gas primarily from the Pocahontas #3 seam. It also has the right to capture Coal Mine Methane from active and abandoned mines in this region. It owns or operates around 2,700 miles of natural gas gathering pipelines as well as a number of natural gas processing facilities.', 'Canonsburg, PA, United States', 458);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FINV', 'STOCK', 'FinVolution Group', 'NYQ', 'Financial Services', 'Credit Services', 'FinVolution Group, formerly PPDAI GROUP INC, is a China-based company mainly engaged in operating an online consumer finance platform. The Companys products and services include loan services offered to borrowers, investment services offered to individual investors and institutional funding partners. The loan services offered to borrowers include standard loan products, consumption loan products and other loan products. The investment services offered to individual investors include self-discretionary investing tools, automated investing tools, investment programs and a secondary loan market. The Company also introduces borrowers to institutional funding partners and provides preliminary credit assessment services as well as other services.', 'Shanghai, , China', 3623);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EOG', 'STOCK', 'EOG Resources, Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'EOG Resources, Inc. É uma empresa de exploração e produção de petróleo bruto e gás natural. A empresa explora, desenvolve, produz e comercializa petróleo bruto, gás natural líquido (NGL) e gás natural principalmente em grandes bacias produtoras nos Estados Unidos, na República de Trinidad e Tobago (Trinidad) e, de tempos em tempos, seleciona outras áreas internacionais. Suas operações estão localizadas nas bacias dos Estados Unidos, com foco em petróleo bruto e gás natural. É focado no Wolfcamp, Bone Spring e Leonard joga. A área do South Texas inclui o jogo Eagle Ford e o jogo de gás Dorado. Ele detém aproximadamente 535 000 acres líquidos totais no jogo Eagle Ford e aproximadamente 160 000 acres líquidos no jogo de gás Dorado. Em Trinidad, a Companhia, através de suas subsidiárias, incluindo EOG Resources Trinidad Limited, detém participação nas licenças de exploração e produção que abrangem o Consórcio da Costa do Sudeste (SECC) e Pelican Blocks, Banyan e Sercan áreas, entre outros.', 'Houston, TX, United States', 3150);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMA', 'STOCK', 'Comerica Incorporated', 'NYQ', 'Financial Services', 'Banks - Regional', 'Comerica Incorporated é uma empresa de serviços financeiros. Os segmentos da Companhia incluem Banco Comercial, Banco de Varejo, Gestão de Riqueza, Finanças e outros. O segmento de Banco Comercial atende às necessidades de pequenas e médias empresas, corporações multinacionais e entidades governamentais, oferecendo vários produtos e serviços, incluindo empréstimos comerciais e linhas de crédito, depósitos, gestão de caixa, entre outros. O segmento Retail Bank inclui uma gama completa de serviços financeiros pessoais, consistindo em empréstimos ao consumidor, coleta de depósitos ao consumidor e originação de empréstimos hipotecários. Oferece uma variedade de produtos de consumo, incluindo contas de depósito, empréstimos parcelados, cartões de crédito e outros. O segmento de Gestão de Riqueza fornece produtos e serviços para indivíduos e famílias abastados, de alto patrimônio líquido e ultra-alto patrimônio líquido, empresários e executivos e clientes institucionais. O segmento financeir', 'Dallas, TX, United States', 7963);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('WAI', 'STOCK', 'Top KingWin Ltd', 'NCM', 'Financial Services', 'Capital Markets', 'Top KingWin Ltd is a holding company principally engaged in corporate business training services, corporate consulting services, advisory and transaction services and sales of devices. The corporate business training services mainly focus on advanced knowledge and new perspectives on the capital markets. The corporate consulting services mainly focus on various aspects of fundraising. The advisory and transaction services aim to connect entrepreneurs and businesses with diversified sources of capital. The sales of devices mainly includes selling devices to support artificial intelligence (AI) data collection and analysis. The Company mainly operates its businesses in the domestic market.', 'Guangzhou, , China', 85);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DDOG', 'STOCK', 'Datadog, Inc.', 'NMS', 'Technology', 'Software - Application', 'Datadog, Inc. É a plataforma de observação e segurança para aplicativos em nuvem. A plataforma de software como serviço (SaaS) da empresa integra e automatiza o monitoramento de infraestrutura, monitoramento de desempenho de aplicativos, gerenciamento de logs, monitoramento de usuários reais e vários outros recursos para fornecer observabilidade e segurança unificadas e em tempo real para toda a pilha de tecnologia de seus clientes. Sua plataforma consiste em produtos que podem ser usados individualmente ou como uma solução unificada e inclui um mercado onde os clientes podem acessar produtos criados por seus parceiros em cima da plataforma Datadog. Os produtos da empresa incluem monitoramento de infraestrutura, monitoramento de desempenho de aplicativos (APM), gerenciamento de log, monitoramento de experiência digital, perfilador contínuo, monitoramento de banco de dados, monitoramento de Rede, Gerenciamento de Incidentes, Pipelines de Observabilidade, Gerenciamento de Custos de Nuvem', 'New York, NY, United States', 6500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNK', 'STOCK', 'Cinemark Holdings, Inc.', 'NYQ', 'Communication Services', 'Entertainment', 'Cinemark Holdings, Inc. is a movie theatre company. The Company is engaged in the motion picture exhibition industry, with theaters in the United States, Brazil, Argentina, Chile, Colombia, Peru, Honduras, El Salvador, Nicaragua, Costa Rica, Panama, Guatemala, Bolivia, and Paraguay. Its segments include U.S. markets and international markets. Its circuit, comprised of various brands that also include Century, Tinseltown and Rave, operates approximately 497 theaters with 5,653 screens in 42 states domestically and 13 countries throughout South and Central America. It plays mainstream films from many different genres, such as animated films, family films, dramas, comedies, horror and action films. It offers content in both 2-D and 3-D formats in all of its theaters, and in many locations, it offers either its own premium large format, XD, IMAX or ScreenX. It offers a variety of alternative entertainment content for its guests, such as concert, sporting and gaming events, and others.', 'Plano, TX, United States', 9252);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DYN', 'STOCK', 'Dyne Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Dyne Therapeutics, Inc. is a clinical-stage neuromuscular disease company. It is discovering and advancing therapeutics for people living with genetically driven neuromuscular diseases. Leveraging the modularity of its FORCE platform, it is developing targeted therapeutics that deliver to muscle and the central nervous system (CNS). It has a broad pipeline for neuromuscular diseases, including clinical programs for myotonic dystrophy type 1 (DM1) and Duchenne muscular dystrophy (DMD) and preclinical programs for facioscapulohumeral muscular dystrophy (FSHD) and Pompe disease. Its product candidate, DYNE-101, is being evaluated in ACHIEVE, an ongoing Phase I/II global clinical trial in patients with DM1. Its product candidate, DYNE-251, is being evaluated in DELIVER, an ongoing Phase I/II global clinical trial in patients with DMD who have mutations amenable to exon 51 skipping. Its other product candidates are DYNE-302 and DYNE-401. DYNE-302 addresses the genetic basis of FSHD.', 'Waltham, MA, United States', 206);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EPRT', 'STOCK', 'Essential Properties Realty Trust, Inc.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Essential Properties Realty Trust, Inc. is an internally managed real estate investment trust (REIT). The Company owns and manages primarily single-tenant properties that are net leased on a long-term basis to companies operating service-oriented or experience-based businesses. The Company has a diversified portfolio that focuses on properties leased to tenants in businesses, including car washes, restaurants (primarily quick service restaurants and casual dining), early childhood education, medical and dental services, convenience stores, automotive services, equipment rental and sales, grocery, entertainment, industrial, and health and fitness. The Companys portfolio consists of about 2,104 freestanding net lease properties with a weighted average lease term of 14 years and a weighted average rent coverage ratio of 3.5x. In addition, the Companys portfolio is leased to about 413 tenants operating 592 different concepts in 16 industries across 49 states.', 'Princeton, NJ, United States', 48);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEN', 'STOCK', 'Franklin Resources, Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'A Franklin Resources, Inc. É uma empresa global de gestão de investimentos com subsidiárias que operam como Franklin Templeton e atendem clientes em mais de 150 países. Através de seus gerentes de investimento especializados, a empresa oferece especialização em escala global, trazendo capacidades em capital próprio, renda fixa, alternativas e soluções multi-ativos. Ele fornece sua gestão de investimentos e serviços relacionados a investidores de varejo, institucionais e de alto patrimônio líquido em jurisdições em todo o mundo. Seus produtos de investimento incluem seus fundos patrocinados, bem como contas separadas institucionais e de alto patrimônio líquido, programas de contas gerenciadas separadamente de varejo, produtos sub-aconselhados e outros veículos de investimento. Seus fundos incluem fundos registrados (incluindo fundos negociados em bolsa) e fundos não registrados. Oferece seus serviços e produtos sob suas várias marcas distintas, incluindo, mas não limitado a, Alcentra, B', 'San Mateo, CA, United States', 10100);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COLB', 'STOCK', 'Columbia Banking System, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Columbia Banking System, Inc. is the bank holding company for Umpqua Bank (the Bank). Through the Bank, the Company provides a broad range of banking, private banking, mortgage, and other financial services to corporate, institutional, small business, and individual customers. The Bank offers commercial lending products, treasury management and payment solutions, deposit products, wealth management services, residential real estate loans, and consumer loans. It offers specialized loans for corporate, middle market, and small business customers, including commercial lines of credit and term loans, accounts receivable and inventory financing, international trade finance, and others. It offers deposit products, including non-interest-bearing checking accounts, analyzed business accounts, interest-bearing checking and savings accounts, money market accounts, insured cash sweep and other investment sweep solutions, and certificates of deposit.', 'Tacoma, WA, United States', 4721);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DBX', 'STOCK', 'Dropbox, Inc.', 'NMS', 'Technology', 'Software - Infrastructure', 'Dropbox, Inc. provides tools to help distributed teams prioritize, get organized, and keep work moving securely from anywhere. The Companys products include Dropbox Passwords, Dropbox Backup, Dropbox Sign, DocSend, Dropbox Dash for Business (Dash), Dropbox Replay and FormSwift, among others. Dropbox Passwords allows users to sign in to Websites and apps by creating and storing usernames and passwords across devices. Dropbox Backup automatically syncs folders on a user''s computer to the cloud. When turned on, files on the user''s personal computer or Mac are continuously backed up on the cloud. Dropbox Sign is an e-signature and document workflow platform that enables customers to easily sign, send and receive documents through its intuitive Web and mobile-based interfaces. DocSend is a secure document sharing and analytics platform. Dropbox Dash is an AI-powered, universal search tool, which enables teams to search, organize, share, and protect content from across their connected app', 'San Francisco, CA, United States', 2204);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNI', 'STOCK', 'Canadian National Railway Company', 'NYQ', 'Industrials', 'Railroads', 'Centuria Capital Group is an Australia-based specialist investment manager. The Company delivers a range of products and services to investors, advisers and security holders. The Company offers a range of investment opportunities, including listed and unlisted real estate funds as well as tax-effective investment bonds. Its principal activities are the marketing and management of investment products including property investment funds and friendly society investment bonds, as well as co-investments in property investment funds. Its segments include Property funds management, Co-investments, Developments, Property and development finance, Investment bonds management and Corporate. Property Funds Management segment is engaged in the management of listed and unlisted property funds. Developments segment manages development projects and completion of structured property developments, which span sectors ranging from commercial office, industrial, health through to residential mixed use.', 'Montreal, QC, Canada', 24912);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OMER', 'STOCK', 'Omeros Corporation', 'NGM', 'Healthcare', 'Biotechnology', 'Omeros Corporation is a biopharmaceutical company. The Company is focused on discovering, developing and commercializing small-molecule and protein therapeutics for large-market and orphan indications targeting immunologic disorders, including complement-mediated diseases, cancers, and addictive and compulsive disorders. Its lead MASP-2 inhibitor, narsoplimab, targets the lectin pathway of complement and is the subject of a biologics license application pending before FDA for the treatment of hematopoietic stem cell transplant-associated thrombotic microangiopathy. Its long-acting MASP-2 inhibitor, OMS1029, is in phase I single- and multiple-ascending-dose clinical studies. OMS906, its inhibitor of MASP-3, the key activator of the alternative pathway of complement, is advancing in clinical programs for paroxysmal nocturnal hemoglobinuria and complement 3 glomerulopathy. Its lead phosphodiesterase 7 inhibitor OMS527 is in clinical development for the treatment of cocaine use disorders.', 'Seattle, WA, United States', 202);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAPR', 'STOCK', 'Capricor Therapeutics, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Capricor Therapeutics, Inc. is a biotechnology company developing transformative cell and exosome-based therapeutics for the treatment and prevention of rare diseases. The Company''s program is focused on the development and commercialization of a cell therapy technology comprised of cardiosphere-derived cells (CDCs) for the treatment of Duchenne muscular dystrophy (DMD). Its lead product candidate deramiocel (also referred to as CAP-1002), is an allogeneic cardiac-derived cell therapy. CAP-1002 is advancing through Phase III clinical development for the treatment of Duchenne muscular dystrophy (DMD). CAP-1002 demonstrates immunomodulatory, antifibrotic, and regenerative actions specifically tailored for dystrophinopathies and heart disease. It leverages its exosome technology, using its StealthX platform in preclinical development focused on the areas of vaccinology, targeted delivery of oligonucleotides, proteins, and small molecule therapeutics.', 'San Diego, CA, United States', 160);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CB', 'STOCK', 'Chubb Limited', 'NYQ', 'Financial Services', 'Insurance - Property & Casualty', 'Chubb Limited é uma holding sediada na Suíça. A Companhia, através de suas subsidiárias, fornece uma gama de produtos e serviços de seguros e resseguros a clientes em todo o mundo. Seus segmentos incluem o seguro de propriedade comercial e acidentes (P&C) da América do Norte, seguro pessoal de P&C da América do Norte, seguro agrícola da América do Norte, seguro geral ultramarino, resseguro global e seguro de vida. Ele oferece produtos de seguros comerciais e ofertas de serviços, como programas de gerenciamento de riscos, controle de perdas e engenharia e gerenciamento complexo de sinistros. Fornece produtos de seguros especializados para áreas como aviação e energia. Ele também oferece cobertura de seguro de linhas pessoais, incluindo proprietários, automóveis, objetos de valor, responsabilidade de guarda-chuva e produtos marinhos recreativos. Além disso, fornece seguro de acidentes pessoais, saúde suplementar e vida a indivíduos em países selecionados.', 'Zurich, , Switzerland', 43000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DLTR', 'STOCK', 'Dollar Tree, Inc.', 'NMS', 'Consumer Defensive', 'Discount Stores', 'A Dollar Tree, Inc. É uma operadora de lojas de variedades com desconto. Seus segmentos de negócios incluem Dollar Tree e Family Dollar. O segmento Dollar Tree é o operador de lojas de variedades com desconto que oferecem mercadorias predominantemente ao preço fixo. Suas lojas estão operando sob as marcas Dollar Tree e Dollar Tree Canada. Opera 15 centros de distribuição nos Estados Unidos e dois no Canadá. As lojas da Dollar Tree consistem em mercadorias consumíveis, mercadorias de variedade e produtos sazonais. O segmento Family Dollar opera lojas de varejo de mercadorias em geral, fornecendo aos clientes uma seleção de mercadorias em lojas de bairro convenientes. O segmento Family Dollar consiste em suas operações de loja sob a marca Family Dollar e 10 centros de distribuição. As lojas Family Dollar consistem em produtos consumíveis, produtos domésticos, produtos de vestuário e acessórios, e produtos sazonais e eletrônicos. Também possui marcas comerciais, incluindo Family Dollar e ', 'Chesapeake, VA, United States', 64434);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('MFH', 'STOCK', 'Mercurity Fintech Holding Inc.', 'NCM', 'Technology', 'Information Technology Services', 'Mercurity Fintech Holding Inc. is a digital fintech company. The Company, along with its subsidiaries, is engaged in distributed computing, business consulting, and financial brokerage business. Its business segments include Business consultation services, Financial advisory services and brokerage services, and Distributed computing and storage services. Business consultation services segment includes business consultation services and industry resource support to global corporate clients based. Financial advisory services and brokerage services segment includes financial advisory services, online and traditional brokerage services. Distributed computing and storage services segment includes blockchain and cryptocurrencies and cryptocurrency mining. The Company''s subsidiaries include Mercurity Fintech Technology Holding Inc., Mercurity Limited, Ucon Capital (HK) Limited, Beijing Lianji Future Technology Co., Ltd., Chaince Securities, and JVDA, LLC.', 'New York, NY, United States', 11);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DUK', 'STOCK', 'Duke Energy Corporation', 'NYQ', 'Utilities', 'Utilities - Regulated Electric', 'Duke Energy Corporation é uma empresa de holding de energia. A empresa opera através de dois segmentos: Serviços Elétricos e Infra-estruturas (EU&I) e Serviços Públicos e Infra-estruturas de Gás (GU&I). O segmento EU&I realiza operações principalmente através das concessionárias públicas regulamentadas de Duke Energy Carolinas, Duke Energy Progress, Duke Energy Florida, Duke Energy Indiana e Duke Energy Ohio. A EU&I fornece serviço elétrico de varejo através da geração, transmissão, distribuição e venda de eletricidade para clientes nas regiões Sudeste e Centro-Oeste dos Estados Unidos. O segmento GU&I realiza operações de gás natural principalmente através das concessionárias públicas regulamentadas de Piedmont, Duke Energy Ohio e Duke Energy Kentucky. A Gu&I serve clientes residenciais, comerciais, industriais e de geração de energia de gás natural, incluindo clientes atendidos por municípios que são clientes grossistas. Também adquire um portfólio diversificado de serviços de transp', 'Charlotte, NC, United States', 26413);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BBY', 'STOCK', 'Best Buy Co., Inc.', 'NYQ', 'Consumer Cyclical', 'Specialty Retail', 'A Best Buy Co., Inc. Está envolvida na personalização e humanização de soluções de tecnologia. Atua em dois segmentos: Nacional e internacional. O segmento doméstico compreende suas operações em todos os estados, distritos e territórios dos Estados Unidos e seu negócio de Best Buy Health, e inclui as marcas Best Buy, Best Buy Ads, Best Buy Business, Best Buy Essentials, Best Buy Health, Best Buy Health, Best Buy Business, Best Buy Health, saúde Atual, Esquadrão Geek, Imagine That, Insignia, Lively, My Best Buy, My Best Buy Memberships, Pacific Kitchen and Home, TechLiquidators e Yardbird; e os nomes de domínio bestbuy.com, currenthealth.com, lively.com, techliquidators.com e yardbird.com. O segmento internacional compreende todas as operações no Canadá sob as marcas Best Buy, Best Buy Express, Best Buy Mobile, Geek Squad e TechLiquidators e os nomes de domínio bestbuy.ca e techliquidators.ca. Suas categorias de produtos incluem computação e telefones celulares, eletrônicos de consumo, ', 'Richfield, MN, United States', 85000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BAH', 'STOCK', 'Booz Allen Hamilton Holding Corporation', 'NYQ', 'Industrials', 'Consulting Services', 'Booz Allen Hamilton Holding Corporation é a empresa-mãe da empresa de serviços de consultoria e engenharia de gestão e tecnologia, Booz Allen Hamilton Inc. Ele fornece consultoria de gestão e tecnologia, análise, engenharia, soluções digitais, operações de missão, e serviços cibernéticos para governos dos EUA e internacionais. Suas soluções incluem inteligência artificial, nuvem, experiência digital do cliente, treinamento de elite, DevSecOps corporativo, JADC2, prontidão de missão, segurança e força de trabalho do futuro. Ele apoia missões críticas para uma variedade de clientes do governo federal, incluindo quase todos os departamentos de gabinete do governo dos EUA, bem como para clientes comerciais, tanto no mercado interno quanto internacionalmente. Ele apoia seus clientes do governo federal ajudando-os a enfrentar desafios como proteger soldados em combate e apoiar suas famílias. Ele também fornece tecnologias para evoluir missões de defesa e fornece soluções para combatentes na ', 'McLean, VA, United States', 33400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BN', 'STOCK', 'Brookfield Corporation', 'NYQ', 'Financial Services', 'Asset Management', 'A Brookfield Corporation é uma empresa global de investimento sediada no Canadá, focada em construir riqueza de longo prazo para instituições e indivíduos em todo o mundo. A empresa tem três negócios principais: Gestão de ativos alternativos, soluções de riqueza e seus negócios operacionais que estão em energia renovável, infraestrutura, serviços empresariais e industriais e imóveis. Seu negócio de gestão de ativos inclui a gestão de fundos privados de longo prazo, estratégias perpétuas e estratégias líquidas em nome de seus investidores e de si mesmo. Seu negócio de soluções de riqueza inclui sua participação acionária na Brookfield Resseguros Ltd Seu negócio de energia renovável e transição inclui a propriedade, operação e desenvolvimento de hidrelétricas, eólicas e outros. Seu negócio de infraestrutura inclui a propriedade, operação e desenvolvimento de utilidades, transporte, midstream e ativos de dados. Seu negócio de private equity está focado na propriedade e operações no setor ', 'Toronto, ON, Canada', 250000);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DEO', 'STOCK', 'Diageo plc', 'NYQ', 'Consumer Defensive', 'Beverages - Wineries & Distilleries', 'A Diageo plc é um fabricante e distribuidor internacional de bebidas premium com sede no Reino Unido. Possui também vários investimentos em associados e joint ventures. A Companhia possui um portfólio de aproximadamente 200 marcas e vendas em 180 países. Seus segmentos incluem América do Norte, Europa, Ásia-Pacífico, América Latina e Caribe, África, Supply Chain and Procurement (SC&P), e Corporate e outros. O segmento SC&P fabrica produtos e inclui unidades de produção no Reino Unido, Irlanda, Itália, Guatemala e México, bem como compreende a função de aquisição global. Seus principais produtos incluem uísque escocês, outros whisky(e)y, vodka, tequila, gin, rum, licores, cerveja, vinho e álcool sem e com baixo teor de álcool. A coleção de marcas da Companhia inclui as vodkas Johnnie Walker, Crown Royal, J&B e Buchanan, Smirnoff, Ciroc e Ketel One, Capitão Morgan, Baileys, Don Julio e Tanqueray, entre outros. Ele também oferece Ritual Zero Proof Non-alcoholic Spirits (Ritual).', 'London, , United Kingdom', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRGY', 'STOCK', 'Crescent Energy Company', 'NYQ', 'Energy', 'Oil & Gas Integrated', 'Crescent Energy Company is an energy company. The Companys operations are focused on Texas and the Rockies with active development in the Eagle Ford and Uinta basins. It also operates conventional assets in Wyoming, where it is active in carbon capture, use and storage (CCUS). It is an operator in the Eagle Ford with a proven ability to scale and safely capture operational upside. It operates in both the oil and condensate windows of the Eagle Ford. Its Uinta position has a large inventory of low-risk undeveloped locations with significant resource potential across multiple, prolific formations. The Uinta basin produces high-value crude, and it has secured takeaway capacity into the Salt Lake City refining complex. Its Wyoming operations comprise low-decline conventional production spanning numerous conventional fields. It operates two enhanced oil recovery projects (EOR) in Wyoming.', 'Houston, TX, United States', 987);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEM', 'STOCK', 'Agnico Eagle Mines Limited', 'NYQ', 'Basic Materials', 'Gold', 'Agnico Eagle Mines Limited is a Canada-based and led senior gold mining company engaged in producing precious metals from operations in Canada, Australia, Finland and Mexico, with a pipeline of exploration and development projects. Its operations include Canadian Malartic Complex, Detour Lake, Fosterville, Goldex, Kittila, La India, LaRonde Complex, Macassa, Meadowbank Complex, Meliadine and Pinos Altos. Its exploration sites include Barsele, Delta, Dubuisson, El Barqueno, Hammond Reef, Hope Bay, Jennings, Morelos Sur, North Madsen, Northern Territory, Pandora/Wood-Pandora, and others. The Canadian Malartic complex is located in the town of Malartic, 25 kilometers (km) west of Val-dOr in northwestern Quebec. The Fosterville mine is a high-grade, low-cost underground gold mine, located 20 km from the city of Bendigo. It also owns a 100% interest in all its properties (128,680 hectares) in Quebec. Its projects also include Marban Alliance, Horizon, Alpha, Launay, Peacock, and others.', 'Toronto, ON, Canada', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUZ', 'STOCK', 'Cousins Properties Incorporated', 'NYQ', 'Real Estate', 'REIT - Office', 'Primos Properties Incorporated é uma confiança de investimento imobiliário totalmente integrada, auto-administrada e auto-gerida (REIT). A empresa realiza seus negócios através da Cousins Properties LP (CPLP), que investe principalmente em prédios de escritórios de Classe A localizados em mercados de alto crescimento da Sun Belt. Possui mais de 99% da CPLP e consolida a CPLP. A CPLP é totalmente proprietária da Cousins TRS Services LLC (CTRS), que possui e gerencia seu próprio portfólio imobiliário e realiza determinados serviços relacionados ao setor imobiliário. A Companhia, CPLP, CTRS e suas subsidiárias desenvolvem, adquirem, locam, gerenciam e possuem principalmente propriedades de escritório Classe A e desenvolvimentos de uso misto nos mercados da Sun Belt dos Estados Unidos com foco em Atlanta, Austin, Tampa, Charlotte, Phoenix, Phoenix, EUA, EUA. Dallas, e Nashville. Suas operações são realizadas no segmento imobiliário de escritório. Seu portfólio de ativos imobiliários consis', 'Atlanta, GA, United States', 306);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRNC', 'STOCK', 'Cerence Inc.', 'NMS', 'Technology', 'Software - Application', 'A Cerence Inc. É uma fornecedora de assistentes alimentados por inteligência artificial (IA) para veículos conetados e autônomos. A empresa constrói assistentes virtuais baseados em IA para o mercado de mobilidade/transporte. Sua plataforma de software é usada para criar assistentes virtuais que podem se comunicar, encontrar informações e agir em uma variedade de categorias em expansão. Sua plataforma de software tem uma arquitetura híbrida que combina componentes de software de borda com componentes conetados à nuvem. Seus componentes de software Edge são instalados na unidade principal de um veículo e podem operar sem acesso a redes e informações externas. Seus componentes conetados à nuvem incluem determinadas tecnologias relacionadas à compreensão de linguagem natural e de fala, personalização habilitada por IA e estruturas de resposta baseadas em contexto e uma plataforma de integração de conteúdo. Assistentes virtuais criados com sua plataforma de software abordam solicitações de', 'Burlington, MA, United States', 1400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AREC', 'STOCK', 'American Resources Corporation', 'NCM', 'Basic Materials', 'Coking Coal', 'American Resources Corporation is a supplier of high raw materials to the new infrastructure market. The Company is focused on the extraction and processing of metallurgical carbon, an essential ingredient used in steelmaking, critical and rare earth minerals for the electrification market, and reprocessed metal to be recycled. It has a portfolio of operations located in the Central Appalachian basin of eastern Kentucky and southern West Virginia. Its subsidiaries include American Carbon Corp. American Carbon Corp. has over seven coal mining and processing operating subsidiaries: McCoy Elkhorn Coal LLC, Knott County Coal LLC, Deane Mining, LLC (Deane Mining), Wyoming County Coal LLC (Wyoming County), Quest Processing LLC (Quest Processing), Perry County Resources, located in eastern Kentucky and western West Virginia within the Central Appalachian coal basin, and ERC Mining Indiana Corporation (ERC) located in southwest Indiana within the Illinois coal basin.', 'Fishers, IN, United States', 23);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRK', 'STOCK', 'Comstock Resources, Inc.', 'NYQ', 'Energy', 'Oil & Gas E&P', 'Comstock Resources, Inc. is an independent energy company. The Company is engaged in the acquisition, exploration, development and production of oil and natural gas in the United States. The Company operates through the exploration and production of the North American natural gas and oil segment. Its primarily operates in the Haynesville shale, a natural gas basin located in North Louisiana and East Texas, with economic and geographical proximity to the Gulf Coast natural gas markets. The Company is focused on the development of drilling opportunities in the Haynesville and Bossier shales and exploration activities in the Western Haynesville play. It has over 1,099,090 acres (819,489 net) prospective for the Haynesville and Bossier shale plays, located in North Louisiana and East Texas, including its extension of the plays in its Western Haynesville area. The Company owns interests in over 2,427 producing natural gas and oil wells (1,542.6 net) and it operates 1,747 of these wells.', 'Frisco, TX, United States', 256);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFG', 'STOCK', 'Citizens Financial Group, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Citizens Financial Group, Inc. Oferece uma gama de produtos e serviços bancários comerciais e de varejo para indivíduos, pequenas empresas, empresas de médio mercado, grandes corporações e instituições. A Companhia atua através de dois segmentos: Banca de Consumo e Banca Comercial. O segmento de Consumer Banking atende clientes de consumo e pequenas empresas, com produtos e serviços que incluem depósitos, empréstimos hipotecários e capital próprio, cartões de crédito, empréstimos para pequenas empresas, gestão de patrimônio e serviços de investimento em grande parte em sua pegada bancária tradicional de 14 estados. O segmento Consumer Banking opera aproximadamente 1 000 filiais, incluindo 143 locais na loja, e aproximadamente 3 100 caixas eletrônicos. O segmento de Banca Comercial atende principalmente empresas e instituições com produtos e soluções financeiras, incluindo empréstimos e leasing, serviços de gestão de depósitos e tesouraria, câmbio, taxa de juros e soluções de gestão de ', 'Providence, RI, United States', 17677);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BX', 'STOCK', 'Blackstone Inc.', 'NYQ', 'Financial Services', 'Asset Management', 'Blackstone Inc. is an alternative asset manager. The Companys assets under management include global investment strategies focused on real estate, private equity, infrastructure, life sciences, growth equity, credit, real assets, secondaries and hedge funds. It operates through four segments: Real Estate, Private Equity, Credit & Insurance and Multi-Asset Investing. Its Real Estate segment primarily comprises its management of opportunistic real estate funds, Core+ real estate funds, and real estate debt strategies. Its Credit & Insurance segment consists principally of Blackstone Credit & Insurance, which is organized into three overarching strategies: private corporate credit, liquid corporate credit and infrastructure and asset-based credit. Multi-Asset Investing is organized into two primary platforms: Absolute Return and Multi-Strategy. In addition, the segment also includes a publicly traded energy infrastructure, renewables and master limited partnership investment platform.', 'New York, NY, United States', 4895);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARBK', 'STOCK', 'Argo Blockchain plc', 'NMS', 'Financial Services', 'Capital Markets', 'Argo Blockchain plc is a United Kingdom-based blockchain technology company focused on large-scale mining of Bitcoin. It mines using purpose-built computers (or mining machines) to solve complex cryptographic algorithms (or verify or solve blocks) on the blockchain in exchange for rewards and fees denominated in the native token of that blockchain network. Its mining fleet primarily consists of Bitmain Antminer S19, S19 Pro, S19J Pro, and ePIC BlockMiners, all of which utilize advanced application-specific-integrated-circuits (ASICs) designed specifically for cryptocurrency mining. Its fleet of miners is operational in its Quebec facility, with additional hosted sites in North America. Its Baie Comeau location is over 40,000 square feet and operates around 15 megawatts (MW). The Baie Comeau hydroelectric dam generates 100% renewable power. The Company''s subsidiaries include Argo Innovation Labs Inc., Argo Operating US LLC, and Argo Holdings US Inc.', 'London, , United Kingdom', 25);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRBR', 'STOCK', 'BellRing Brands, Inc.', 'NYQ', 'Consumer Defensive', 'Packaged Foods', 'BellRing Brands, Inc. is a consumer product holding company. The Company is a provider of ready-to-drink (RTD) protein shakes, other RTD beverages, powders and nutrition bars. The Company operates through protein-based consumer goods. The Companys primary brands are Premier Protein and Dymatize. Premier Proteins product portfolio consists of RTD protein shakes, refreshing protein beverages and protein powders. Dymatize brands portfolio includes an assortment of sports nutrition products, including protein powders. Dymatize protein powder portfolio consists of three primary products: ISO.100 made with hydrolyzed 100% Whey Protein Isolate, Elite 100% Whey and Super Mass Gainer. The Companys products are distributed across a diverse network of channels including club, food, drug and mass (FDM), e-Commerce, specialty and convenience.', 'Saint Louis, MO, United States', 485);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EA', 'STOCK', 'Electronic Arts Inc.', 'NMS', 'Communication Services', 'Electronic Gaming & Multimedia', 'Electronic Arts Inc. É uma empresa de entretenimento digital interativo. A Empresa desenvolve, comercializa, publica e entrega jogos, conteúdos e serviços que podem ser jogados pelos consumidores em uma variedade de plataformas, que incluem consoles de jogos, computadores pessoais (PCs), telefones celulares e tablets. Seu portfólio inclui a Propriedade Intelectual (IP) que possui integralmente, como Apex Legends, Battlefield e The Sims ou licenças de outros, como as licenças dentro do EA SPORTS FC e EA SPORTS Madden NFL. Desenvolve e publica jogos e serviços em diversos gêneros, como esportes, corridas, tiro em primeira pessoa, ação, interpretação de papéis e simulação. A Companhia comercializa e vende seus jogos e serviços por meio de canais de varejo e canais de distribuição digital. A Empresa também oferece serviços ao vivo, incluindo conteúdo extra, ofertas de assinatura e venda de seus jogos base e jogos gratuitos. A Empresa também oferece seu serviço de assinatura EA Play em cons', 'Redwood City, CA, United States', 14500);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AM', 'STOCK', 'Antero Midstream Corporation', 'NYQ', 'Energy', 'Oil & Gas Midstream', 'Antero Midstream Corporation is a midstream energy company. The Company owns, operates and develops midstream gathering, compression, processing and fractionation assets located in the Appalachian Basin, as well as integrated water assets that primarily service Antero Resources Corporations (Antero Resources) properties. The Companys assets consist of gathering systems and compression facilities, water handling and blending facilities and interests in processing and fractionation plants. The Companys segments include gathering and processing and water handling. The gathering and processing segment includes a network of gathering pipelines and compressor stations that collect and process production from Antero Resources wells in the Appalachian Basin, as well as equity in earnings from its investments in the Joint Venture and Stonewall. The water handling segment includes two independent systems that deliver water from sources and other fluid handling services.', 'Denver, CO, United States', 616);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('HR', 'STOCK', 'Healthcare Realty Trust Incorporated', 'NYQ', 'Real Estate', 'REIT - Healthcare Facilities', 'Healthcare Realty Trust Incorporated é uma confiança de investimento imobiliário auto-gerida e auto-administrada (REIT) que possui e opera edifícios médicos ambulatoriais localizados principalmente em torno de campi hospitalares. A empresa cresce seletivamente seu portfólio por meio de aquisição e desenvolvimento de imóveis. Seu portfólio inclui quase 700 propriedades totalizando mais de 40 milhões de pés quadrados concentrados em 15 mercados em crescimento. A Empresa atua em um amplo espetro de serviços integrados, incluindo leasing, gestão, aquisição, financiamento, desenvolvimento e redesenvolvimento de tais propriedades. Ele se concentra em instalações localizadas principalmente nos campi de hospitais de cuidados agudos associados aos sistemas de saúde. As propriedades da empresa em mercados de alto crescimento com uma ampla mistura de inquilinos que inclui mais de 30 especialidades médicas, bem como cirurgia, imagem, câncer e centros de diagnóstico. O portfólio imobiliário da Comp', 'Nashville, TN, United States', 550);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CAKE', 'STOCK', 'The Cheesecake Factory Incorporated', 'NMS', 'Consumer Cyclical', 'Restaurants', 'The Cheesecake Factory Incorporated is an experiential dining company focused on hospitality. The Company owns and operates about 352 restaurants throughout the United States and Canada under brands, including The Cheesecake Factory (215 locations), North Italia (43 locations), Flower Child (38 locations), and a collection within its Fox Restaurant Concepts (FRC) portfolio (49 locations). Internationally, 34 The Cheesecake Factory restaurants operate under licensing agreements. Its bakery division operates two facilities that produce cheesecakes and other baked products for its restaurants, international licensees, and third-party bakery customers. The Cheesecake Factory menu features about 225 items, exclusive of beverage and dessert items and including items presented on supplemental menus, such as its SkinnyLicious menu that offers items at 590 calories or less. Its menu offerings include appetizers, pizza, seafood, steaks, chicken, burgers, small plates, pastas, salads, and others.', 'Calabasas, CA, United States', 47900);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NWSA', 'STOCK', 'News Corporation', 'NMS', 'Communication Services', 'Entertainment', 'A News Corporation é uma empresa diversificada de mídia e serviços de informação. Seu segmento de Serviços imobiliários digitais consiste no interesse da Companhia pelo Grupo REA e pela Move. REA Group é uma empresa de mídia digital especializada em imóveis e serviços relacionados à propriedade em seus sites e aplicativos móveis. A Move é uma provedora de serviços imobiliários digitais nos Estados Unidos e opera principalmente uma plataforma de informação imobiliária, publicidade e serviços, bem como seus serviços baseados em referência, ferramentas on-line e serviços para proprietários e inquilinos. Seu segmento Dow Jones consiste na Dow Jones, uma provedora global de notícias e informações de negócios, que distribui seu conteúdo e dados por meio de uma variedade de canais de mídia. Seu segmento de publicação de livros consiste em HarperCollins, uma editora de livros de consumo com operações em 15 países. Seu segmento de mídia de notícias é composto pela News Corp Australia, News UK e', 'New York, NY, United States', 22300);\n
